commit.message:
Enable formatting of XMPP status in roster

This enables to use colours and glyphs in the XMPP roster
making it easier to discern who is online/offline/unavailable/etc
when displaying the roster.

See the following example on how to do formatting of the roster and
availability status:

  "fe-common/xmpp" = {
     # FORMAT
     format_name = "{nick $0} {nickhost $1}";
     format_jid  = "{nick $0}";
     format_resource = "{comment $0{hilight $1}($2)$3}";
     format_resource_show = "($0)";
     format_resource_status = ": $0";
     format_subscription = "(sub: $0)";

     # PRESENCE *new*
     presence_unavailable = "%K() ->%n";
     presence_error       = "%r(!) ->%n";
     presence_xa          = "%r(x) ->%n";
     presence_dnd         = "%r(x) ->%n";
     presence_away        = "%y(-) ->%n";
     presence_available   = "%_%g(+) ->%n";
     presence_chat        = "%_%g(+) ->%n";
     presence_online      = "%_%g(+) ->%n";

     # QUERIES
     query_aka = "%g>>%n    {nick $1} -> ({nick $0})";

     # PRESENCE
     presence_change        = " %y%n $0: is now {hilight $1}";
     presence_change_reason = " %y%n $0: is now {hilight $1} {comment $2}";

     # ROSTER FORMATTING
     begin_of_roster = "%r|| %n %g>>%n Roster: {nick $0} $1 $2";
     roster_group    = " %g+%n [{hilight $0}]";
     roster_contact  = " %y%n   $0 $1%n"; # orig: "   ({hilight $0}) $1 $2 $3"
     end_of_roster   = "%r|| %n";
  };
